import React from "react";
import PropTypes from 'prop-types'
export default function Gasto({ gasto }) {
  return (
    <li className="gastos">
      <p>{gasto.nombre}
      <span className="gasto">
          $ {gasto.cantidad}
      </span>
      </p>
    </li>
  );
 
}
Gasto.propTypes={
  gasto : PropTypes.object.isRequired  
}
